import './styles.css';

function StepsHeader () {
    return (
        <header className="orders-steps-container">
            <div className="orders-steps-content">
                <h1 className="steps-title">
                    SIGA AS <br /> ETAPAS
                </h1>
            </div> 
        </header>
    )
}

export default StepsHeader;
